    RIGHT_ID, RIGHT_NAME, DESCRIPTION, UPDATE_USER, UPDATE_TIMESTAMP, RIGHTS_TYPE_CODE
)
SELECT 
    (SELECT MAX(RIGHT_ID) + 1 FROM RIGHTS) AS ID,
    'MAINTAIN_SCHEDULER_MONITOR',
    'To maintain scheduler monitor',
    'admin',
    UTC_TIMESTAMP(),
    '1'
WHERE NOT EXISTS (
    SELECT 1 FROM RIGHTS WHERE RIGHT_NAME = 'MAINTAIN_SCHEDULER_MONITOR'
);







